(77, 'Гарантия и условия возврата', 'Гарантия отсутствия грыж и сквозных порезов. Иных гарантий, а так же возвратов - нет. Возврата по причине неверного выбора размера и т.п. - НЕТ! \r\n\r\n1. Для местных - осмотр на месте, проверка на шиномонтаже ул. Мокрушина 9 за ваш счет, с учетом разумных затрат моего времени. Товар б/у, может иметь следы эксплуатации, существенно отличаться от нового. При сохранении возможности использования, претензии не принимаются. \r\n2. Для регионов - высылаем только по предоплате. Гарантия, что вас не кинут и соответствия качества - наш рейтинг <a target="_blank" href="http://baza.drom.ru/user/wheels70/feedbacks?role=buyer">http://baza.drom.ru/user/wheels70/feedbacks?role=buyer</a> а так же большое количество продаваемых лотов. После отправки получаете фото накладной. \r\n\r\nШины проверены на наличие грыж, шишек и порезов в надутом состоянии. Остальное видно на фото. Без предоплаты доп. фото не делаю. С людьми не понимающими отличие б/у от нового товара - не работаем. \r\nВ подтверждение качества - наша репутация и рейтинг <a target="_blank" href="http://baza.drom.ru/user/wheels70/feedbacks?role=buyer">http://baza.drom.ru/user/wheels70/feedbacks?role=buyer</a>', 1, 'managerActions', 0, 3),
(78, 'Гарантия и условия возврата', 'Для местных - осмотр на месте, проверка на ближайшем шиномонтаже за ваш счет, с учетом разумных затрат моего времени. Товар б/у, имеет следы эксплуатации, гарантий, возвратов - НЕТ.\r\n\r\nВнимание!\r\n1. Параметры в описании, ищите в интернете. Возврата по причине того что вам не подошли купленные диски - НЕТ.\r\n2. На фото именно эти диски. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в своем городе. \r\n3. Товар б/у, с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров)\r\n4. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра и осмотра на балнсире дефектах. Покупатель берет на себя риски покупки б/у товара и перевозки дисков транспортной компанией.\r\n5. Правила и порядок сделки устанавливаются продавцом и отработаны за 3 года работы. Приходящие со своим уставом покупатели заносятся в черный список без объяснения причин.\r\n\r\nОтправляем только по полной предоплате.\r\nГарантия - что вас не кинут - рейтинг <a target="_blank" href="http://baza.drom.ru/user/wheels70/feedbacks?role=buyer">http://baza.drom.ru/user/wheels70/feedbacks?role=buyer</a> а так же большое количество продаваемых лотов.\r\nПосле отправки получаете номер или фото накладной. Не несем ответственности за работу тк.', 2, 'managerActions', 0, 3),
